import './Quote.css';
import Media from 'react-media';

// Quote view component
export default function ReturnQuOteNeveR() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-quote-never'>
  <h1>Never miss a thing</h1>
  <p>Sign up for texts to be notified about our best offers.*</p>
  <span>Sign up for texts</span>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-quote-never-sm'>
  <h1>Never miss a thing</h1>
  <p>Sign up for texts to be notified about our best offers.*</p>
  <span>Sign up for texts</span>
 </div>
);
